import Feature from "./pages/feature";
import { red, green, yellow } from "@material-ui/core/colors";

// Create a theme instance.
const theme = createTheme({
  palette: {
    type: "light",
    primary: {
      main: "#42A5f6",
    },
    secondary: {
      main: "#000000",
    },
    success: {
      main: green.A400,
    },
    warning: {
      main: yellow.A400,
    },
    error: {
      main: red.A400,
    },
    border: {
      main: "#D5D5D5",
      light: "#F1F1F1",
    },
  },
});

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundImage: "url()",
    backgroundPosition: "center",
    minHeight: "100vh",
    width: "100wh",
    background: "#0002",
  },
}));

